def get_primes(n):
    primes = {}
    for possiblePrime in range(2, n + 1):
        isPrime = True
        for num in range(2, int(possiblePrime ** 0.5) + 1):
            if possiblePrime % num == 0:
                isPrime = False
                break
        if isPrime:
            primes[possiblePrime] = True
    return list(primes.keys())[:10]
print(get_primes(50))
